import React, { Component } from "react";

class Connection extends Component {
	render() {
		return (
				<div>
                    <h1>About</h1>
                    <p>This is a Fleet Management System for monitoring and controlling IIUM Medibots</p>
				</div>
		);
	}
}

export default Connection;
